query.sfwSql:
UPDATE SGT_PERSON_ACCOUNT_RETIREMENT_HISTORY SET ADDL_EE_CONTRIBUTION_PERCENT = 0 WHERE PERSON_ACCOUNT_RETIREMENT_HISTORY_ID = @HISTORY_ID AND ADDL_EE_CONTRIBUTION_PERCENT = -1;
UPDATE PA SET PA.ADDL_EE_CONTRIBUTION_PERCENT = 0 FROM SGT_PERSON_ACCOUNT AS PA INNER JOIN SGT_PERSON_ACCOUNT_RETIREMENT_HISTORY PARH on PARH.PERSON_ACCOUNT_ID = PA.PERSON_ACCOUNT_ID WHERE PERSON_ACCOUNT_RETIREMENT_HISTORY_ID = @HISTORY_ID AND PA.ADDL_EE_CONTRIBUTION_PERCENT = -1;
UPDATE PA SET PA.ADDL_EE_CONTRIBUTION_PERCENT_TEMP = 0 FROM SGT_PERSON_ACCOUNT AS PA INNER JOIN SGT_PERSON_ACCOUNT_RETIREMENT_HISTORY PARH on PARH.PERSON_ACCOUNT_ID = PA.PERSON_ACCOUNT_ID WHERE PERSON_ACCOUNT_RETIREMENT_HISTORY_ID = @HISTORY_ID AND PA.ADDL_EE_CONTRIBUTION_PERCENT_TEMP = -1;
IF(@WSS_PERSON_ACCOUNT_ENROLLMENT_REQUEST_ID > 0) BEGIN UPDATE SGT_WSS_PERSON_ACCOUNT_ENROLLMENT_REQUEST SET ADDL_EE_CONTRIBUTION_PERCENT = 0 WHERE WSS_PERSON_ACCOUNT_ENROLLMENT_REQUEST_ID = @WSS_PERSON_ACCOUNT_ENROLLMENT_REQUEST_ID AND ADDL_EE_CONTRIBUTION_PERCENT = -1;
UPDATE SGT_WSS_PERSON_ACCOUNT_ENROLLMENT_REQUEST SET ADDL_EE_CONTRIBUTION_PERCENT_TEMP = 0 WHERE WSS_PERSON_ACCOUNT_ENROLLMENT_REQUEST_ID = @WSS_PERSON_ACCOUNT_ENROLLMENT_REQUEST_ID AND ADDL_EE_CONTRIBUTION_PERCENT_TEMP = -1; END ELSE BEGIN UPDATE PAER SET ADDL_EE_CONTRIBUTION_PERCENT = 0 FROM SGT_WSS_PERSON_ACCOUNT_ENROLLMENT_REQUEST PAER INNER JOIN SGT_PERSON_ACCOUNT PA ON PA.PERSON_ACCOUNT_ID = PAER.TARGET_PERSON_ACCOUNT_ID INNER JOIN SGT_PERSON_ACCOUNT_RETIREMENT_HISTORY PARH ON PARH.PERSON_ACCOUNT_ID = PA.PERSON_ACCOUNT_ID WHERE PARH.PERSON_ACCOUNT_RETIREMENT_HISTORY_ID = @HISTORY_ID AND PAER.ADDL_EE_CONTRIBUTION_PERCENT = -1
UPDATE PAER SET ADDL_EE_CONTRIBUTION_PERCENT_TEMP = 0 FROM SGT_WSS_PERSON_ACCOUNT_ENROLLMENT_REQUEST PAER INNER JOIN SGT_PERSON_ACCOUNT PA ON PA.PERSON_ACCOUNT_ID = PAER.TARGET_PERSON_ACCOUNT_ID INNER JOIN SGT_PERSON_ACCOUNT_RETIREMENT_HISTORY PARH ON PARH.PERSON_ACCOUNT_ID = PA.PERSON_ACCOUNT_ID WHERE PARH.PERSON_ACCOUNT_RETIREMENT_HISTORY_ID = @HISTORY_ID AND PAER.ADDL_EE_CONTRIBUTION_PERCENT_TEMP = -1 END
